import React from "react";
import styled from "styled-components";

const IphoneContact = () => {
    return (
        <IphoneContactsContainer>
            <img src="/iPhoneImage/Contacts/avatar.svg"></img>
            <h1 className="SF_h1">Данила Ворновицкий</h1>
            <Mobile>
                <MobileTitle className="SF_bodySmall">мобильный</MobileTitle>
                <div>
                    <a className="SF_body" href="tel:++79999797515">+7 (999) 979-75-15</a>
                </div>
            </Mobile>
            <Email>

            </Email>
            <Address>

            </Address>
        </IphoneContactsContainer>
    )
}

const IphoneContactsContainer = styled.div`
    width: 100%;
    height: 80%;
    display: flex;
    flex-direction: column;
    align-items: center;
`

const Mobile = styled.div`
    width: 90%;
    height: 62px;
    background-color: white;
    margin: .5em 0px;
    border-radius: 11px;
    justify-content: center;
    display: flex;
    flex-direction: column; 
    justify-content: center;
`

const MobileTitle = styled.div`
    padding-left: .5em;
`

const Email = styled.div`
    width: 90%;
    height: 62px;
    background-color: white;
    margin: .5em 0px;
    border-radius: 11px;
`

const Address = styled.div`
    width: 90%;
    height: 62px;
    background-color: white;
    margin: .5em 0px;
    border-radius: 11px;
`

export default IphoneContact;
